import React from 'react'
import Navbar from '../components/navbar/navbar'
import Sidebar from '../components/sidebar/sidebar'

const sidebar_options = {
    marginTop: {
        marginTop: "2vh"
    },
    blank: false,
    blocks: {
        item1: {
            title: "Add Movie",
            link: "/createMovie"
        },
        item2: {
            title: "List View",
            link: "/listview"
        },
        item3: {
            title: "Multi View",
            link: "/multiview"
        }
    }
}

const UserPage = () => {
    return(
        <div className="single_page_background">
            <Navbar />
            <Sidebar input={sidebar_options}/>
            <div style={page}>
                <p>Welcome to the Movie Database</p>
                <p>Your Username Is:</p>
                <p>{localStorage.getItem("username")}</p>
                <p>Your User ID Is:</p>
                <p>{localStorage.getItem("userId")}</p>
            </div>
        </div>
    );
}

const page = {
    width: "85%",
    height: "100%",
    float: "right",
    display: "flex",
    flexDirection: "column"
}

export default UserPage
